// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract AIAgent {
    address public owner;
    string public status;
    string public latestAction;

    constructor() {
        owner = msg.sender;
        status = "Idle";
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Not authorized");
        _;
    }

    function updateStatus(string calldata _status) external onlyOwner {
        status = _status;
    }

    function logAction(string calldata _action) external onlyOwner {
        latestAction = _action;
    }
}

